import "./conversationScreen.css";
import "./usersList.css";
import { useState, useEffect } from "react";
import Content from "./content";
import NonContent from "./nonContent";
function UsersList() {
  const [clients, setClients] = useState(false);
  const [coachs, setCoachs] = useState(false);
  const [sup, setSup] = useState(false);
  const ChooseClient = useEffect(() => {
      setClients(true);
      setCoachs(false);
      setSup(false);
      console.log(clients);
    }, []);
  
  function ChooseCoach() {
    useEffect(() => {
      setClients(false);
      setCoachs(true);
      setSup(false);
      console.log(coachs);
    }, []);
  }
  function ChooseSup() {
    useEffect(() => {
      setClients(false);
      setCoachs(false);
      setSup(true);
      console.log(sup);
    }, []);
  }

  return (
    <div className="usersListWrapper">
      <div className="usersType">
        <div
          onClick={useEffect(() => {
            setClients(!clients);
            console.log(clients);
          }, [])}
        >
          <div className={clients ? "clicked" : "type"} onClick={ChooseClient} >Clients</div>
        </div>
        <div className={`${coachs ? "clicked" : "type"}`} onClick={ChooseCoach}>
          Coachs
        </div>
        <div className={sup ? "clicked" : "type"} onClick={ChooseSup}>
          Superviseurs
        </div>
      </div>
      {clients ? <Content /> : <NonContent />}
    </div>
  );
}
export default UsersList;
